css:
.editor .wrap-guide,
:host .wrap-guide {
  background: rgba(255, 255, 255, 0.1);
}
.editor .indent-guide,
:host .indent-guide {
  color: rgba(255, 255, 255, 0.1);
}
.editor,
:host,
.editor .gutter,
:host .gutter {
  background-color: #282828;
  color: #F8F8F2;
}
.editor.is-focused .cursor,
:host.is-focused .cursor {
  border-color: #F8F8F0;
}
.editor.is-focused .selection .region,
:host.is-focused .selection .region {
  background-color: rgba(255, 0, 0, 0.2);
}
.editor.is-focused .line-number.cursor-line-no-selection,
:host.is-focused .line-number.cursor-line-no-selection,
.editor.is-focused .line.cursor-line,
:host.is-focused .line.cursor-line {
  background-color: #3D3D3D;
}
.editor .comment,
:host .comment {
  color: #777777;
}
.editor .string,
:host .string {
  color: #E6DB74;
}
.editor .constant.numeric,
:host .constant.numeric {
  color: #AE81FF;
}
.editor .constant.language,
:host .constant.language {
  color: #AE81FF;
}
.editor .constant.character,
:host .constant.character,
.editor .constant.other,
:host .constant.other {
  color: #AE81FF;
}
.editor .keyword,
:host .keyword {
  color: #F92672;
}
.editor .storage,
:host .storage {
  color: #F92672;
}
.editor .storage.type,
:host .storage.type {
  font-style: italic;
  color: #66D9EF;
}
.editor .entity.name.class,
:host .entity.name.class {
  text-decoration: underline;
  color: #A6E22E;
}
.editor .entity.other.inherited-class,
:host .entity.other.inherited-class {
  font-style: italic;
  text-decoration: underline;
  color: #A6E22E;
}
.editor .entity.name.function,
:host .entity.name.function {
  color: #A6E22E;
}
.editor .variable.parameter,
:host .variable.parameter {
  font-style: italic;
  color: #FD971F;
}
.editor .entity.name.tag,
:host .entity.name.tag {
  color: #F92672;
}
.editor .entity.other.attribute-name,
:host .entity.other.attribute-name {
  color: #A6E22E;
}
.editor .support.function,
:host .support.function {
  color: #66D9EF;
}
.editor .support.constant,
:host .support.constant {
  color: #66D9EF;
}
.editor .support.type,
:host .support.type,
.editor .support.class,
:host .support.class {
  font-style: italic;
  color: #66D9EF;
}
.editor .invalid,
:host .invalid {
  color: #F8F8F0;
  background-color: #F92672;
}
.editor .invalid.deprecated,
:host .invalid.deprecated {
  color: #F8F8F0;
  background-color: #AE81FF;
}
